    [],nt"num_tags": 27,nt"name": "annual-water-management-program-1987-erie-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "The management of water levels on refuge
    impoundments is critical in meeting refuge waterfowl objectives. These objectives
    are: 1) Provide nesting habitat for waterfowl, 2) Provide resting and feeding habitat
    for migrant birds, 3) Provide opportunities for public enjoyment and recreation
    involving waterfowl. During the year water levels will be maintained to create habitat
    conditions which allow these objectives to be met. Other objectives of the water
    management plan are to: control rough fish populations, control vegetation, minimize
    the effects of spring floods and ice damage to the impoundments and to control furbearer
    damage to the impoundments.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
